    { id: 1, link: "https://www.linkedin.com/in/yajur-vashisht/", icon: <AiOutlineLinkedin /> },
    { id: 2, link: "https://github.com/yvashisht", icon: <AiFillGithub /> },
    { id: 3, link: "https://www.instagram.com/yajphotography", icon: <AiOutlineInstagram /> },
]

export default data;
